INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (10030, 2002, "ルルィ", 1, "2025/03/15 15:00:00", 5.53, "2025/06/23 14:59:59", 1, -470.0, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 8, 136902, 0.0, 2);
